<!DOCTYPE html><html lang='ko'><head><meta charset='UTF-8'><title>컴퓨터활용능력 2급 기출 복원문제 모의고사 2회</title><meta name='viewport' content='width=device-width, initial-scale=1' /><style>
  body { font-family: "맑은 고딕", system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif; line-height: 1.6; background:#f5f7fb; margin:0; }
  .wrap { max-width: 1100px; margin: 18px auto 70px; background:#fff; border:1px solid #e6e8ef; border-radius:14px; padding:20px 24px 32px; box-shadow:0 6px 24px rgba(0,0,0,.05); }
  .header { display:flex; align-items:center; gap:14px; }
  .header img.logo { width:72px; height:72px; border-radius:50%; border:1px solid #e6e8ef; object-fit:cover; }
  h1 { margin:0; font-size:1.55rem; }
  .subtitle { color:#667089; margin-top:4px; }
  #scoreBox { margin:16px 0; font-weight:800; background:#eef5ff; padding:10px 12px; border-radius:10px; }
  .q { border:1px solid #eceff5; border-radius:12px; padding:14px; margin: 12px 0; }
  .q-head { font-weight:800; margin-bottom:8px; }
  .stem { white-space: normal; }
  .stem-img { max-width:100%; height:auto; border:1px solid #e6e8ef; border-radius:10px; margin:8px 0 10px; }
  .choices { display:grid; grid-template-columns: repeat(1, minmax(0,1fr)); gap:8px; margin-top:6px; }
  .choice { border:1px solid #e6e8ef; border-radius:10px; padding:8px; display:flex; align-items:flex-start; gap:10px; }
  .choice-title { font-weight:700; margin-bottom:2px; }
  .choice img { max-width:100%; height:auto; border:1px solid #e6e8ef; border-radius:8px; display:block; margin-top:6px; }
  .badge { display:inline-block; padding:2px 6px; border-radius:6px; font-size:.82rem; margin-right:8px; }
  .ok { background:#e8f8ea; color:#0e832c; border:1px solid #bee9c7; }
  .no { background:#ffeceb; color:#d11124; border:1px solid #ffd0cb; }
  .explain { color:#0b5fff; white-space: normal; display:inline; line-height:1.6; }
  .controls { margin-top:12px; display:flex; gap:10px; flex-wrap:wrap; }
  button.primary { padding:10px 16px; background:#0b5fff; color:#fff; border:none; border-radius:10px; font-weight:800; cursor:pointer; }
  button.ghost { padding:10px 16px; background:#fff; color:#333; border:1px solid #ddd; border-radius:10px; cursor:pointer; }
.exp-img{max-width:100%;height:auto;border:1px solid #e6e8ef;border-radius:10px;margin-top:6px;}
.choice.side{display:grid;grid-template-columns:46px 1fr;align-items:flex-start}
.choice.side .opt-left{display:flex;align-items:center;gap:6px;margin-top:12px}
.choice.side .opt-num{font-weight:700}

const root = document.getElementById('quiz');


function render() {
  const root = document.getElementById('quiz');
  root.innerHTML = '';
  quiz.forEach(q => {
    const box = document.createElement('div');
    box.className = 'q';

    // head
    const head = document.createElement('div');
    head.className = 'q-head';
    const stemText = (q.stem || '').replace(/\s+/g, ' ').trim();
    head.textContent = `${q.no}. ${stemText}`;
    box.appendChild(head);

    // stem image
    if (q.stem_img) {
      const img = document.createElement('img');
      img.src = q.stem_img;
      img.alt = '문항 ' + q.no + ' 이미지';
      img.className = 'stem-img';
      box.appendChild(img);
    }

    const choices = document.createElement('div');
    choices.className = 'choices';
    const texts = q.choices && q.choices.length === 4 ? q.choices : ["", "", "", ""];
    texts.forEach((txt, idx) => {
      const cnum = idx + 1;
      const row = document.createElement('label');

      const hasImg = q.choice_imgs && q.choice_imgs[idx];
      const imgTag = hasImg ? `<img src="${q.choice_imgs[idx]}" alt="문항 ${q.no} 보기 ${cnum}">` : '';
      const choiceText = (txt || '').replace(/\s+/g, ' ').trim();

      // Special layout for 28,31 when image-only choices
      const needsSideNumber = (q.no === 28 || q.no === 31) && hasImg && !choiceText;
      if (needsSideNumber) {
        row.className = 'choice side';
        row.innerHTML = `
          <div class="opt-left">
            <input type="radio" name="q${q.no}" value="${cnum}">
            <span class="opt-num">${cnum}.</span>
          </div>
          <div class="opt-right">${imgTag}</div>`;
      } else {
        row.className = 'choice';
        row.innerHTML = `
          <input type="radio" name="q${q.no}" value="${cnum}" style="margin-top:4px;">
          <div style="flex:1;">
            <div class="choice-title">${cnum}. ${choiceText}</div>
            ${imgTag}
          </div>`;
      }

      choices.appendChild(row);
    });
    box.appendChild(choices);

    const res = document.createElement('div');
    res.id = 'r' + q.no;
    box.appendChild(res);

    root.appendChild(box);
  });
}
render();



document.getElementById('submitBtn').addEventListener('click', function() {
  let correct = 0, wrong = 0, blank = 0;
  const total = quiz.length;

  quiz.forEach(q => {
    const radios = document.getElementsByName('q' + q.no);
    let picked = null;
    radios.forEach(r => { if (r.checked) picked = Number(r.value); });

    const res = document.getElementById('r' + q.no);
    const answer = q.answer;
    const explainRaw = (q.explain || '').replace(/\s+/g,' ').trim();
  const explain = explainRaw.replace(/※/g,'<br>※');

    if (picked === answer) {
      correct++;
      res.innerHTML = `<span class="badge ok">정답</span> <span class="explain">(${answer}번) ${explain}</span>` + (q.explain_img ? `<div class="explain"><img src="${q.explain_img}" class="exp-img"></div>` : "");
    } else if (picked === null) {
      blank++;
      res.innerHTML = `<span class="badge no">미응답</span> <span class="explain">정답은 ${answer}번 — ${explain}</span>` + (q.explain_img ? `<div class="explain"><img src="${q.explain_img}" class="exp-img"></div>` : "");
    } else {
      wrong++;
      res.innerHTML = `<span class="badge no">오답</span> <span class="explain">정답은 ${answer}번 — ${explain}</span>` + (q.explain_img ? `<div class="explain"><img src="${q.explain_img}" class="exp-img"></div>` : "");
    }
  });

  const rate = (correct / total * 100).toFixed(1);
  const box = document.getElementById('scoreBox');
  box.textContent = `총점: ${correct} / ${total} (정답률 ${rate}%) • 오답: ${wrong} • 미응답: ${blank}`;
});

document.getElementById('resetBtn').addEventListener('click', function() {
  document.querySelectorAll('input[type=radio]').forEach(r => r.checked = false);
  document.querySelectorAll('[id^=r]').forEach(el => el.textContent = '');
  document.getElementById('scoreBox').textContent = '제출하면 점수가 여기 표시됩니다.';
});
</script></body></html>
